// homeServiceBox.jsx
import React, { useState, useEffect } from 'react';

const HomeServiceBox = ({ link, servImg, servTitle, servDesc }) => {
    const [loaded, setLoaded] = useState(false);

    useEffect(() => {
        const img = new Image();
        img.src = servImg;
        img.onload = () => setLoaded(true);
    }, [servImg]);

    return (
        <div className={`homeServiceBox ${loaded ? 'loaded' : ''}`}>
            <Link to={link}>
                <img src={servImg} alt={servTitle} />
                <h3>{servTitle}</h3>
                <p>{servDesc}</p>
            </Link>
        </div>
    );
};

export default HomeServiceBox;
